import { Morph} from "lively.morphic";
import L2LClient from "lively.2lively/client.js";

export default class ObjectChatWidget extends Morph {
   async remoteSend(formattedMessage) {
    if (!this.client){
      this.connect();
      await this.client.whenRegistered();
    }
    var trackerId = this.client.trackerId

    var msg = {
          action: "l2lMessage", target: 'l2lChat',
          data: {payload: formattedMessage},
          messageId: "l2lChatMessage"
        }
    var ackFn = (a)=>{console.log(a)}
    [msg, ackFn] = this.client.prepareSend(msg, ackFn);

    this.client.sendTo(trackerId,"broadcast",{broadcastMessage: msg,roomName: 'l2lChat'},ackFn)

  }


  onLoad() {

    var textMorphs = [
      $world.get('ChatPane'),
      $world.get('MessageBox')
    ]

    textMorphs.forEach(function(ea){
      if(ea.attributeConnections && ea.attributeConnections[0]){
        ea.attributeConnections[0].disconnect()
      }
    })

    $world.__proto__.setUserId = function(name){
      $world.userId = name
    }
    $world.__proto__.getUserId = function(){
      if((!$world.userId) || (typeof $world.userId != 'string')){
        return {type: 'error', data: 'Missing or invalid user Id'}
      }
      return {type: 'success', data: $world.userId}
    }
    this.loaded = true;
  }
  onLoadFromPartsBin(){
    console.log('Load Complete')
    this.onLoad();
  }
  aMessage(msgBody){
    var user = $world.getUserId()
    if (user.type == 'error'){
      return {
        type: 'error',
        data: 'msg not sent, error encountered',
        error: user
      }
    }
    var timeStamp = new Date();
    return ("<" + timeStamp.toTimeString().split('(')[0] + "> | " + user.data + " | : " + msgBody + '\n')
  }
  sendMessage(msg) {
  if (typeof msg != 'string' || msg == ''){return}
    var formattedMessage = this.aMessage(msg)
    if (formattedMessage.type == 'error'){
      if (formattedMessage.error.data == "Missing or invalid user Id"){
        var person = window.prompt("Please enter user Id", "LivelyUser");
        if (person != null) {
          $world.setUserId(person)
          this.sendMessage(msg)
        }
      }

      return;
    }
    this.postMessage(formattedMessage)
    this.remoteSend(formattedMessage)
  }
  postMessage(formattedMessage) {
    var chatPane = this.get('ChatPane')
    chatPane.textString += formattedMessage
    this.get('MessageBox').textString = ''

  }

  async connect(){
    if (!this.client){
      this.client = L2LClient.forceNew();
      await this.client.whenRegistered();
      this.chatSetup();
    }

  }

  async disconnect() {
    if(this.client){
      await this.client.remove();
      delete this.client;
    }
  }
  chatSetup() {
    var trackerId = this.client.trackerId
    var self = this;
    this.client.sendTo(trackerId,'joinRoom',{roomName: 'l2lChat'})
    this.client.addService('l2lMessage',(tracker,msg,ackFn,sender) => {
      self.postMessage(msg.data.payload)
    })
  }
}

